import React, {Component} from 'react';
import './WeaponIcon.css';

class WeaponIcon extends Component {
    constructor(props) {
        super(props);

        this.state = {
            id: props.weaponId,
            type: props.weaponType
        }
    }

  render() {
      return (
        <div class="weapon-background" data-id={this.state.id} data-type={this.state.type}>
            <div class="weapon-icon-container">
                <div class="weapon-icon" data-id={this.state.buildId.meleeId} data-type="melee"></div>
            </div>
        </div>
    );
  }

}

export default WeaponIcon;
